import React from 'react';

function AppFooter(){
    return (
        <div style={footerContainer}>
            <h1>Hello</h1>
        </div>
    )
}

let footerContainer ={
    borderTop: '3px #fed766 solid',
    padding: '20px',
    background: 'yellow',
    display: 'flex',
    
}

export default AppFooter;
